import React from 'react';

const ExampleSite = () => {
  return (
    <div style={{
      width: '100%',
      height: '100vh',
      overflow: 'hidden',
      border: 'none',
      margin: 0,
      padding: 0
    }}>
      <iframe 
        src="/example-site/index.html"
        style={{
          width: '100%',
          height: '100%',
          border: 'none',
          background: 'white',
          margin: 0,
          padding: 0
        }}
        title="Example Property Management Site"
        sandbox="allow-scripts allow-same-origin allow-forms"
      />
    </div>
  );
};

export default ExampleSite;
